import '../App.css';


function NavBar() {
  return (
    <div className="NavBar">
    <nav>
      <img src="https://cdn.iconscout.com/icon/premium/png-256-thumb/shop-logo-2362986-1972632.png" alt=""></img>
      <ul>
        <li ><a href="#">Home</a></li>
        <li ><a href="#">News</a></li>
        <li ><a href="#">Contacts</a></li>
        <li ><a href="#">About</a></li>
      </ul>
    </nav>
    </div>
  );
}

export default NavBar;
